import React from 'react';
import './Experience.css';
import { FaHeartbeat, FaProcedures, FaStethoscope } from 'react-icons/fa';
import { useNavigate } from 'react-router-dom';
import DataLogo from "../assets/DataLogo.jpeg";
import BrightLogo from "../assets/BrightLogo.jpeg";

const Services = () => {
  const navigate = useNavigate();  // Initialize useNavigate

  const goToDatalyzer = () => {
    navigate('/datalyzer-details');
    }  // Programmatic navigation to Datalyzer details

  const goToBrightChamps = () => {
    navigate('/brightchamps-details'); 
  } 
  return (
    <section id="services" className="services">
      <h2>Experience</h2>
      <div className="services-container">
        <div className="service-item">
          <img src={DataLogo} className="service-icon" />
          <h3>Datalyzer</h3>
          <p>Software Engineer</p>
          <p id='des'> Two years of professional experience in both software engineering and education. As a Software Engineer at Datalyzer International Inc. <br></br>(May 2022 – July 2023)</p>
          <a href="#learn-more">Learn more</a>
        </div>
        <div className="service-item">
        <img src={BrightLogo} className="service-icon" />
          <h3>BrightChamps</h3>
          <p>Coding Instructor</p>
          <p id='des'> I worked as a Coding Instructor at BrightChamps Pvt. Ltd., where I taught diverse groups of students and created tailored coding curriculums across various technologies such as HTML, JavaScript, Python, and Machine Learning.<br></br>(March 2021 – April 2022)</p>
          <a href="#learn-more">Learn more</a>
        </div>
      </div>
    </section>
  );
};

export default Services;
